function getRoomInfo(){
    var code = document.getElementById('code').value;
    var row = getRow(code);
    if(row){
        row--;
         //ADD ROWS HERE
         set("Court",lookUp(row,"Court"));
         set("House",lookUp(row,"House"));
         set("Room",lookUp(row,"Room"));
         set("Floor",lookUp(row,"Floor"));
    }else{
        alert("Unknown room");
    }
}

function lookUp(row,column){
return data[row][column];
}

function getRow(code){
for(i=0;i<data.length;i++){
     if(data[i]['Code']==code){
          return i+1;
     }
}
return false;
}

function set(id,value){
     var element = document.getElementById(id);
     if(value!=null){
     element.innerHTML= id + ": " + value;
 }else{
     element.innerHTML= id +": N/A";
 }
}
